import React from 'react';
import { NavLink } from 'react-router-dom';

export default function SignedOutLinks() {
  return (
    <ul className="right navlinks">
      <li>
        <NavLink to="/signin" className="navlinks">
          Log In
        </NavLink>
      </li>
      <li>
        <NavLink to="/signup" className="navlinks">
          Sign Up
        </NavLink>
      </li>
    </ul>
  );
}
